export default class PageNotFound extends React.Component {

    render() {
        return (
            <>
                <HeaderComponent></HeaderComponent>
                <FunctionalHeaderComponent></FunctionalHeaderComponent>
                <NotFoundComponent></NotFoundComponent>
            </>
        );
    }
}
